#!/usr/bin/env bash
###
# install-turret-sounds.sh
# Self-contained installer for Portal Turret sound effects for Claude Code hooks.
# All 21 .wav files are embedded (base64) — no external downloads needed.
#
# Events:
#   SessionStart      → Deploy / active / search sounds
#   UserPromptSubmit  → Autosearch / active / search sounds
#   Stop              → Disabled / retire sounds
#   Notification      → Pickup / tipped / autosearch (permission prompts only)
#
# Prerequisites:
#   - macOS (uses afplay + base64 -D)
#
# Usage: bash install-turret-sounds.sh
###
set -euo pipefail

SOUNDS_DIR="$HOME/.claude/hooks/sounds/turret"
mkdir -p "$SOUNDS_DIR"

echo "Extracting 21 Portal Turret sound files..."

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_active1.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_active2.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_active5.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_autosearch1.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_autosearch2.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_autosearch3.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_autosearch4.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_autosearch5.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_deploy1.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_disabled1.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_disabled3.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_disabled4.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_disabled7.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_pickup1.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_pickup2.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_retire1.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_retire2.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_retire5.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_search1.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_search2.wav"

B64EOF

base64 -D << 'B64EOF' > "$SOUNDS_DIR/turret_tipped4.wav"

B64EOF

echo ""
echo "Done! Portal Turret sounds installed to $SOUNDS_DIR"
echo "To test: afplay $SOUNDS_DIR/turret_deploy1.wav"
